from typing import List


# 1631. 最小体力消耗路径
# 提示
# 中等
# 408
# 相关企业
# 你准备参加一场远足活动。给你一个二维 rows x columns 的地图 heights ，其中 heights[row][col] 表示格子 (row, col) 的高度。一开始你在最左上角的格子 (0, 0) ，且你希望去最右下角的格子 (rows-1, columns-1) （注意下标从 0 开始编号）。你每次可以往 上，下，左，右 四个方向之一移动，你想要找到耗费 体力 最小的一条路径。
#
# 一条路径耗费的 体力值 是路径上相邻格子之间 高度差绝对值 的 最大值 决定的。
#
# 请你返回从左上角走到右下角的最小 体力消耗值 。
#
#
#
# 示例 1：
#
#
#
# 输入：heights = [[1,2,2],[3,8,2],[5,3,5]]
# 输出：2
# 解释：路径 [1,3,5,3,5] 连续格子的差值绝对值最大为 2 。
# 这条路径比路径 [1,2,2,2,5] 更优，因为另一条路径差值最大值为 3 。
# 示例 2：
#
#
#
# 输入：heights = [[1,2,3],[3,8,4],[5,3,5]]
# 输出：1
# 解释：路径 [1,2,3,4,5] 的相邻格子差值绝对值最大为 1 ，比路径 [1,3,5,3,5] 更优。
# 示例 3：
#
#
# 输入：heights = [[1,2,1,1,1],[1,2,1,2,1],[1,2,1,2,1],[1,2,1,2,1],[1,1,1,2,1]]
# 输出：0
# 解释：上图所示路径不需要消耗任何体力。
#


class Solution:
    def minimumEffortPath(self, heights: List[List[int]]) -> int:
        m = len(heights)
        n = len(heights[0])
        me = [[math.inf] * n for _ in range(m)]
        # me[0][0] = 0
        # for i in range(1, m):
        #     me[i][0] = max(me[i - 1][0], abs(heights[i][0] - heights[i - 1][0]))
        # for i in range(1, n):
        #     me[0][i] = max(me[0][i - 1],abs(heights[0][i] - heights[0][i - 1]))
        #
        # for i in range(1, m):
        #     for j in range(1, n):
        #         a = max(me[i - 1][j], abs(heights[i][j] - heights[i - 1][j]))
        #         b = max(me[i][j - 1], abs(heights[i][j] - heights[i][j - 1]))
        #         me[i][j] = min(a, b)
        # me[-1][-1] = 0
        # for i in range(m - 2, -1, -1):
        #     me[i][-1] = min(me[i][-1], max(me[i + 1][-1], abs(heights[i][-1] - heights[i + 1][-1])))
        # for i in range(n - 2, -1, -1):
        #     me[-1][i] = min(me[-1][i], max(me[-1][i + 1], abs(heights[-1][i] - heights[-1][i + 1])))
        #
        # for i in range(m - 2, -1, -1):
        #     for j in range(n - 2, -1, -1):
        #         me[i][j] = min(me[i][j], max(me[i + 1][j], abs(heights[i][j] - heights[i + 1][j])))
        #         me[i][j] = min(me[i][j], max(me[i][j + 1], abs(heights[i][j] - heights[i][j + 1])))
        # for i in range(1, m):
        #     for j in range(1, n):
        #         a = max(me[i - 1][j], abs(heights[i][j] - heights[i - 1][j]))
        #         b = max(me[i][j - 1], abs(heights[i][j] - heights[i][j - 1]))
        #         me[i][j] = min(a, b)
        # return me[-1][-1]

        q = [(0, 0, 0)]
        heapq.heapify(q)
        searched = set()
        me[0][0] = 0
        while q:
            c = heapq.heappop(q)
            if c[1] == m - 1 and c[2] == n - 1:
                return c[0]
            searched.add((c[1], c[2]))
            for i in [-1, 1]:
                if 0 <= c[1] + i < m and (c[1] + i, c[2]) not in searched:
                    a = me[c[1] + i][c[2]]
                    me[c[1] + i][c[2]] = min(me[c[1] + i][c[2]],
                                         max(me[c[1]][c[2]], abs(heights[c[1]][c[2]] - heights[c[1] + i][c[2]])))
                    if me[c[1] + i][c[2]] < a:
                        heapq.heappush(q, (me[c[1] + i][c[2]], c[1] + i, c[2]))
                if 0 <= c[2] + i < n and (c[1], c[2] + i) not in searched:
                    a = me[c[1]][c[2] + i]
                    me[c[1]][c[2] + i] = min(me[c[1]][c[2] + i],
                                         max(me[c[1]][c[2]], abs(heights[c[1]][c[2]] - heights[c[1]][c[2] + i])))
                    if me[c[1]][c[2] + i]< a:
                        heapq.heappush(q, (me[c[1]][c[2] + i], c[1], c[2] + i))

        return me[-1][-1]


